import React, { useEffect } from "react";
import logo from "../assets/coxdiack-logo.png";
import img1 from "../assets/code.jpg";
import img2 from "../assets/influencer.jpg";
import img3 from "../assets/digital.jpg";
import img4 from "../assets/webdesign.jpg";
import AOS from "aos";
import "aos/dist/aos.css";


// ✅ Scroll fade animation variant
const fadeUp = {
  hidden: { opacity: 0, y: 50 },
  visible: {
    opacity: 1,
    y: 0,
    transition: { duration: 1.2, ease: "easeOut" },
  },
};

const Home = () => {
  return (
    <div className="w-full bg-[#0A1837] text-white font-sans overflow-hidden">
      {/* HERO SECTION */}
      <motion.section
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true, amount: 0.3 }}
        variants={fadeUp}
        className="max-w-7xl mx-auto px-6 md:px-10 lg:px-16 py-20 flex flex-col items-center text-center bg-gradient-to-b from-[#0A1837] to-[#0E1B45]"
      >
        {/* LOGO */}
        <motion.img
          src={logo}
          alt="Coxdiack Group Logo"
          className="w-40 sm:w-48 md:w-56 lg:w-64 mb-6 drop-shadow-[0_0_15px_#00FFA340]"
          variants={fadeUp}
          whileHover={{ scale: 1.05, filter: "drop-shadow(0 0 25px #00FFA3)" }}
        />

        {/* HERO TEXT */}
        <motion.h1
          className="text-3xl md:text-4xl lg:text-5xl font-bold mb-3 leading-tight"
          variants={fadeUp}
        >
          Welcome to <span className="text-[#00FFA3]">Coxdiack Group</span>
        </motion.h1>

        <motion.p
          className="text-gray-300 max-w-2xl leading-relaxed mb-6 text-sm md:text-base"
          variants={fadeUp}
        >
          We craft digital experiences and creative solutions for modern brands.
          Explore our portfolio to see what we’ve been up to.
        </motion.p>

        <motion.div variants={fadeUp}>
          <Link
            to="portfolio"
            smooth={true}
            duration={700}
            className="cursor-pointer bg-[#00FFA3] text-[#0A1837] font-semibold py-2 px-6 rounded-full transition-all duration-300 hover:shadow-[0_0_25px_#00FFA3] hover:scale-105"
          >
            Explore Portfolio
          </Link>
        </motion.div>
      </motion.section>

      {/* EXPLORE SECTION */}
      <motion.section
        id="portfolio"
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true, amount: 0.3 }}
        variants={fadeUp}
        className="bg-gradient-to-b from-[#0E1B45] via-[#0A1837] to-[#0E1B45] py-16 px-6 md:px-10 lg:px-16 text-center"
      >
        <h2 className="text-2xl md:text-3xl font-bold text-[#00FFA3] mb-10">
          Explore Our Digital World
        </h2>

        {/* ✅ Image Grid */}
        <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-4 gap-6 justify-center">
          {[img1, img2, img3, img4].map((image, i) => (
            <motion.img
              key={i}
              src={image}
              alt={`portfolio-${i}`}
              className="rounded-xl shadow-lg w-full h-56 sm:h-60 object-cover transition-all duration-500 hover:scale-105 hover:shadow-[0_0_25px_#00FFA3]"
              variants={fadeUp}
              whileHover={{ scale: 1.05 }}
            />
          ))}
        </div>
      </motion.section>

      {/* ABOUT SECTION */}
      <motion.section
        id="about"
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true, amount: 0.3 }}
        variants={fadeUp}
        className="py-16 px-6 md:px-10 lg:px-16 text-center bg-gradient-to-b from-[#0E1B45] to-[#0A1837]"
      >
        <h2 className="text-2xl md:text-3xl font-bold mb-6 text-[#00FFA3]">
          About Coxdiack Group
        </h2>
        <p className="text-gray-300 max-w-3xl mx-auto leading-relaxed text-sm md:text-base">
          At <span className="text-[#00FFA3] font-medium">Coxdiack Group</span>,
          we bridge creativity and technology to elevate brands in the digital
          era. From stunning web design to social media storytelling and
          strategic growth, our goal is to empower your brand to thrive online.
        </p>
        <div className="mt-8">
          <Link
            to="contact"
            smooth={true}
            duration={700}
            className="cursor-pointer bg-[#00FFA3] text-[#0A1837] font-semibold py-2 px-6 rounded-full hover:shadow-[0_0_25px_#00FFA3] hover:scale-105 transition-all duration-300"
          >
            Reach Us
          </Link>
        </div>
      </motion.section>

      {/* CONTACT SECTION */}
      <motion.section
        id="contact"
        initial="hidden"
        whileInView="visible"
        viewport={{ once: true, amount: 0.3 }}
        variants={fadeUp}
        className="bg-gradient-to-b from-[#0A1837] to-[#0E1B45] py-16 px-6 md:px-10 lg:px-16 text-center"
      >
        <h2 className="text-2xl md:text-3xl font-bold text-[#00FFA3] mb-6">
          Contact Coxdiack Group
        </h2>
        <p className="text-gray-300 max-w-xl mx-auto mb-8 text-sm md:text-base">
          Let’s collaborate to create something extraordinary. Reach out to us
          via email, WhatsApp, or follow our updates on Facebook.
        </p>

        <div className="flex justify-center gap-6 text-[#00FFA3] text-2xl">
          <a
            href="mailto:info@coxdiackgroup.com"
            className="transition-all hover:scale-125 hover:drop-shadow-[0_0_15px_#00FFA3]"
          >
            <i className="fa-solid fa-envelope"></i>
          </a>
          <a
            href="https://wa.me/639000000000"
            target="_blank"
            rel="noreferrer"
            className="transition-all hover:scale-125 hover:drop-shadow-[0_0_15px_#00FFA3]"
          >
            <i className="fa-brands fa-whatsapp"></i>
          </a>
          <a
            href="https://facebook.com/CoxdiackGroup"
            target="_blank"
            rel="noreferrer"
            className="transition-all hover:scale-125 hover:drop-shadow-[0_0_15px_#00FFA3]"
          >
            <i className="fa-brands fa-facebook"></i>
          </a>
        </div>

        <p className="text-gray-500 text-xs mt-10">
          © 2025 Coxdiack Group. All Rights Reserved.
        </p>
      </motion.section>
    </div>
  );
};

export default Home;
